import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import styled from 'styled-components';
import { FiTruck, FiSave, FiArrowLeft } from 'react-icons/fi';
import { theme } from '../../styles/theme';
import { Card, Button, Input, Select } from '../../styles/GlobalStyles';
import { Vehicle } from '../../types';

const CreateVehicleContainer = styled.div`
  display: flex;
  flex-direction: column;
  gap: ${theme.spacing.xl};
  max-width: 800px;
  margin: 0 auto;
`;

const PageHeader = styled.div`
  display: flex;
  align-items: center;
  gap: ${theme.spacing.md};
`;

const BackButton = styled(Button)`
  padding: ${theme.spacing.sm};
`;

const PageTitle = styled.h1`
  font-size: ${theme.typography.fontSize['3xl']};
  font-weight: ${theme.typography.fontWeight.bold};
  color: ${theme.colors.textPrimary};
  margin: 0;
`;

const FormCard = styled(Card)`
  display: flex;
  flex-direction: column;
  gap: ${theme.spacing.xl};
`;

const FormSection = styled.div`
  display: flex;
  flex-direction: column;
  gap: ${theme.spacing.lg};
`;

const SectionTitle = styled.h3`
  font-size: ${theme.typography.fontSize.lg};
  font-weight: ${theme.typography.fontWeight.semibold};
  color: ${theme.colors.textPrimary};
  margin: 0;
  display: flex;
  align-items: center;
  gap: ${theme.spacing.sm};
`;

const FormRow = styled.div`
  display: grid;
  grid-template-columns: 1fr 1fr;
  gap: ${theme.spacing.lg};

  @media (max-width: ${theme.breakpoints.md}) {
    grid-template-columns: 1fr;
  }
`;

const FormGroup = styled.div`
  display: flex;
  flex-direction: column;
  gap: ${theme.spacing.sm};
`;

const Label = styled.label`
  font-size: ${theme.typography.fontSize.sm};
  font-weight: ${theme.typography.fontWeight.medium};
  color: ${theme.colors.textPrimary};
`;

const RequiredIndicator = styled.span`
  color: ${theme.colors.error};
`;

const ActionButtons = styled.div`
  display: flex;
  gap: ${theme.spacing.md};
  justify-content: flex-end;
  padding-top: ${theme.spacing.lg};
  border-top: 1px solid ${theme.colors.border};
`;

const CreateVehicle: React.FC = () => {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    plateNumber: '',
    fleetNumber: '',
    make: '',
    model: '',
    year: new Date().getFullYear(),
    type: 'van' as Vehicle['type'],
    status: 'active' as Vehicle['status'],
    fuelType: 'gasoline' as Vehicle['fuelType'],
    color: '',
    vin: '',
    mileage: 0
  });
  const [isSubmitting, setIsSubmitting] = useState(false);

  const handleInputChange = (field: string, value: string | number) => {
    setFormData(prev => ({
      ...prev,
      [field]: value
    }));
  };

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();

    if (!formData.plateNumber || !formData.fleetNumber || !formData.make || !formData.model || !formData.color || !formData.vin) {
      alert('Please fill in all required fields.');
      return;
    }

    setIsSubmitting(true);

    try {
      const newVehicle: Omit<Vehicle, 'id' | 'createdAt' | 'updatedAt'> = {
        plateNumber: formData.plateNumber,
        fleetNumber: formData.fleetNumber,
        make: formData.make,
        model: formData.model,
        year: formData.year,
        type: formData.type,
        status: formData.status,
        fuelType: formData.fuelType,
        color: formData.color,
        vin: formData.vin,
        mileage: formData.mileage,
        lastMaintenance: new Date(),
        nextMaintenance: new Date(Date.now() + 90 * 24 * 60 * 60 * 1000), // 90 days from now
        currentLocation: {
          lat: 40.7128,
          lng: -74.0060,
          address: 'Fleet Depot'
        }
      };

      console.log('Creating vehicle:', newVehicle);

      // Simulate delay
      await new Promise(resolve => setTimeout(resolve, 1000));

      navigate('/vehicles');
    } catch (error) {
      console.error('Error creating vehicle:', error);
      alert('Error creating vehicle. Please try again.');
    } finally {
      setIsSubmitting(false);
    }
  };

  const handleCancel = () => {
    navigate('/vehicles');
  };

  return (
    <CreateVehicleContainer className="fade-in">
      <PageHeader>
        <BackButton variant="secondary" onClick={handleCancel}>
          <FiArrowLeft />
        </BackButton>
        <PageTitle>Add New Vehicle</PageTitle>
      </PageHeader>

      <form onSubmit={handleSubmit}>
        <FormCard>
          <FormSection>
            <SectionTitle>
              <FiTruck />
              Vehicle Information
            </SectionTitle>

            <FormRow>
              <FormGroup>
                <Label>
                  Plate Number <RequiredIndicator>*</RequiredIndicator>
                </Label>
                <Input
                  type="text"
                  placeholder="e.g., ABC-123"
                  value={formData.plateNumber}
                  onChange={(e) => handleInputChange('plateNumber', e.target.value)}
                  required
                />
              </FormGroup>

              <FormGroup>
                <Label>
                  Fleet Number <RequiredIndicator>*</RequiredIndicator>
                </Label>
                <Input
                  type="text"
                  placeholder="e.g., FL001"
                  value={formData.fleetNumber}
                  onChange={(e) => handleInputChange('fleetNumber', e.target.value)}
                  required
                />
              </FormGroup>
            </FormRow>

            <FormRow>
              <FormGroup>
                <Label>
                  Make <RequiredIndicator>*</RequiredIndicator>
                </Label>
                <Input
                  type="text"
                  placeholder="e.g., Ford"
                  value={formData.make}
                  onChange={(e) => handleInputChange('make', e.target.value)}
                  required
                />
              </FormGroup>

              <FormGroup>
                <Label>
                  Model <RequiredIndicator>*</RequiredIndicator>
                </Label>
                <Input
                  type="text"
                  placeholder="e.g., Transit"
                  value={formData.model}
                  onChange={(e) => handleInputChange('model', e.target.value)}
                  required
                />
              </FormGroup>
            </FormRow>

            <FormRow>
              <FormGroup>
                <Label>Year</Label>
                <Input
                  type="number"
                  min="1990"
                  max={new Date().getFullYear() + 1}
                  value={formData.year}
                  onChange={(e) => handleInputChange('year', parseInt(e.target.value))}
                />
              </FormGroup>

              <FormGroup>
                <Label>
                  Color <RequiredIndicator>*</RequiredIndicator>
                </Label>
                <Input
                  type="text"
                  placeholder="e.g., White"
                  value={formData.color}
                  onChange={(e) => handleInputChange('color', e.target.value)}
                  required
                />
              </FormGroup>
            </FormRow>

            <FormRow>
              <FormGroup>
                <Label>Vehicle Type</Label>
                <Select
                  value={formData.type}
                  onChange={(e) => handleInputChange('type', e.target.value)}
                >
                  <option value="van">Van</option>
                  <option value="truck">Truck</option>
                  <option value="car">Car</option>
                  <option value="motorcycle">Motorcycle</option>
                </Select>
              </FormGroup>

              <FormGroup>
                <Label>Fuel Type</Label>
                <Select
                  value={formData.fuelType}
                  onChange={(e) => handleInputChange('fuelType', e.target.value)}
                >
                  <option value="gasoline">Gasoline</option>
                  <option value="diesel">Diesel</option>
                  <option value="electric">Electric</option>
                  <option value="hybrid">Hybrid</option>
                </Select>
              </FormGroup>
            </FormRow>

            <FormRow>
              <FormGroup>
                <Label>
                  VIN <RequiredIndicator>*</RequiredIndicator>
                </Label>
                <Input
                  type="text"
                  placeholder="Vehicle Identification Number"
                  value={formData.vin}
                  onChange={(e) => handleInputChange('vin', e.target.value)}
                  required
                />
              </FormGroup>

              <FormGroup>
                <Label>Current Mileage</Label>
                <Input
                  type="number"
                  min="0"
                  placeholder="0"
                  value={formData.mileage}
                  onChange={(e) => handleInputChange('mileage', parseInt(e.target.value) || 0)}
                />
              </FormGroup>
            </FormRow>

            <FormRow>
              <FormGroup>
                <Label>Status</Label>
                <Select
                  value={formData.status}
                  onChange={(e) => handleInputChange('status', e.target.value)}
                >
                  <option value="active">Active</option>
                  <option value="maintenance">Maintenance</option>
                  <option value="inactive">Inactive</option>
                </Select>
              </FormGroup>
              <div></div> {/* Empty div for grid alignment */}
            </FormRow>
          </FormSection>

          <ActionButtons>
            <Button 
              type="button" 
              variant="secondary" 
              onClick={handleCancel}
              disabled={isSubmitting}
            >
              Cancel
            </Button>
            <Button 
              type="submit" 
              variant="primary"
              disabled={isSubmitting}
            >
              <FiSave />
              {isSubmitting ? 'Adding...' : 'Add Vehicle'}
            </Button>
          </ActionButtons>
        </FormCard>
      </form>
    </CreateVehicleContainer>
  );
};

export default CreateVehicle;
